import React from 'react';
import { NavLink } from 'react-router-dom';
import './Sidebar.css'; 

const Sidebar: React.FC = () => {
    return (
        <div className="sidebar">
            <nav>
                <ul>
                    <li>
                        <NavLink to="/trainers" className="active-link">
                            Players
                        </NavLink>
                    </li>
                    <li>
                        <NavLink to="/trainers/inactive" className="active-link">
                            Inactive Players
                        </NavLink>
                    </li>
                </ul>
            </nav>
        </div>
    );
};

export default Sidebar;
